import React, { Component } from 'react';
import { observer, inject } from 'mobx-react';
import kakaomap from '../seehomodule/kakaomap';

@inject('pos')
@observer
class Mask extends Component {
  constructor(props) {
  console.log('mask 시작');
  }
  render() {
    const { pos } = this.props;
    return (
      <div>
        {pos.getPosition2()}
        <kakaomap />
        <h1>{pos.mylat}, {pos.mylng}</h1>
      </div>
    );
  }
}

export default Mask;
